import React, { useState } from 'react';
import axiosInstance from './api/axios'; // Using axiosInstance for API requests
import { useNavigate } from 'react-router-dom';

const LoginPage = () => {
    const [step, setStep] = useState(1); // Step 1: Select Tenant/Owner; Step 2: Show Login form
    const [userType, setUserType] = useState(''); // Track user type (Tenant or Owner)
    const [formData, setFormData] = useState({
        email: '',
        password: ''
    });

    const [errors, setErrors] = useState({});
    const [loading, setLoading] = useState(false); // Track loading state
    const navigate = useNavigate(); // For redirection

    // Validate email and password
    const validateInputs = () => {
        let valid = true;
        let newErrors = {};

        const emailPattern = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        if (!emailPattern.test(formData.email)) {
            newErrors.email = 'Email is not valid';
            valid = false;
        }

        if (formData.password === '') {
            newErrors.password = 'Password is required';
            valid = false;
        }

        setErrors(newErrors);
        return valid;
    };

    // Handle login request
    const handleLogin = async () => {
        if (validateInputs()) {
            setLoading(true);
            try {
                const response = await axiosInstance.post('auth/login', {
                    email: formData.email,
                    password: formData.password,
                    userType: userType
                });

                const { token, user } = response.data;
                localStorage.setItem('token', token);
                localStorage.setItem('user', JSON.stringify(user));

                setLoading(false);
                navigate('/dashboard'); // Redirect to the dashboard

            } catch (error) {
                setLoading(false);
                console.error('Login error:', error.response?.data?.msg || 'Login failed');
                setErrors({ email: error.response?.data?.msg || 'Invalid email or password' });
            }
        }
    };

    const handleInputChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleUserTypeSelection = (type) => {
        setUserType(type);
        setStep(2);
    };

    const handleBack = () => {
        setStep(1);
    };

    return (
        <div className="bg-gray-100 py-10 min-h-screen">
            <div className="max-w-3xl mx-auto px-6">
                {step === 1 ? (
                    <div className="bg-white p-10 shadow-xl rounded-lg mb-10 text-center">
                        <h1 className="text-4xl text-customGreen font-bold mb-6">Welcome to DocEase!</h1>
                        <p className="text-lg text-gray-600 mb-6">Are you logging in as a Tenant or an Owner?</p>
                        <div className="flex justify-center space-x-10">
                            <button onClick={() => handleUserTypeSelection('tenant')} className="bg-customGreen text-white py-3 px-6 rounded-lg hover:bg-green-600">Login as Tenant</button>
                            <button onClick={() => handleUserTypeSelection('owner')} className="bg-customGreen text-white py-3 px-6 rounded-lg hover:bg-green-600">Login as Owner</button>
                        </div>
                    </div>
                ) : (
                    <div className="bg-white p-10 shadow-xl rounded-lg mb-10">
                        <h1 className="text-4xl text-customGreen font-bold mb-6 text-center">Login as {userType === 'tenant' ? 'Tenant' : 'Owner'}</h1>
                        <form>
                            <div className="mb-6">
                                <label className="block text-lg text-gray-600 mb-2">Email</label>
                                <input type="email" name="email" value={formData.email} onChange={handleInputChange} className="w-full border border-gray-300 rounded-lg p-3" />
                                {errors.email && <p className="text-red-500 text-sm">{errors.email}</p>}
                            </div>

                            <div className="mb-6">
                                <label className="block text-lg text-gray-600 mb-2">Password</label>
                                <input type="password" name="password" value={formData.password} onChange={handleInputChange} className="w-full border border-gray-300 rounded-lg p-3" />
                                {errors.password && <p className="text-red-500 text-sm">{errors.password}</p>}
                            </div>

                            <button type="button" onClick={handleLogin} className="w-full bg-customGreen text-white py-3 rounded-lg hover:bg-green-600" disabled={loading}>{loading ? 'Logging in...' : 'Login'}</button>

                            <button type="button" onClick={handleBack} className="w-full bg-gray-400 text-white py-3 rounded-lg hover:bg-gray-600 mt-4">Back</button>
                        </form>
                    </div>
                )}
            </div>
        </div>
    );
};

export default LoginPage;
